package com.example.entity;/* * @Author: zl * @Date: 2021/7/8 1:10 **/public class Doctor {    private Integer id;    private String name;    private Integer age;    private String sex;    private String office;    public Integer getId() {        return id;    }    public void setId(Integer id) {        this.id = id;    }    public String getName() {        return name;    }    public void setName(String name) {        this.name = name;    }    public Integer getAge() {        return age;    }    public void setAge(Integer age) {        this.age = age;    }    public String getSex() {        return sex;    }    public void setSex(String sex) {        this.sex = sex;    }    public String getOffice() {        return office;    }    public void setOffice(String office) {        this.office = office;    }    @Override    public String toString(){        return  id +                "," + name +                "," + age +                "," + sex +                "," + office;    }}